// PETCONNECT-FRONTEND/src/App.jsx
import React, { useState, useCallback } from 'react';
import { Routes, Route, Navigate, NavLink, useNavigate } from 'react-router-dom';
import api from './api/axios';
import Toast from './components/Toast';
import Pets from './pages/Pets';
import LostPets from './pages/LostPets';
import Activities from './pages/Activities';
import Register from './pages/Register';
import Login from './pages/Login';

export default function App() {
  const [toasts, setToasts] = useState([]);
  const navigate = useNavigate();

  // Función para añadir un toast
  const addToast = useCallback((message, type = 'info') => {
    const id = Date.now();
    const bg =
      type === 'error' ? '#dc3545' :
      type === 'success' ? '#28a745' :
      '#17a2b8';
    setToasts(ts => [...ts, { id, message, bg }]);
  }, []);

  // Cierra un toast
  const removeToast = useCallback(id => {
    setToasts(ts => ts.filter(t => t.id !== id));
  }, []);

  // Logout: elimina token y redirige a login
  const handleLogout = async () => {
    try {
      await api.post('/api/logout');
      localStorage.removeItem('token');
      addToast('Has cerrado sesión', 'info');
      navigate('/login');
    } catch {
      addToast('Error al cerrar sesión', 'error');
    }
  };

  return (
    <>
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container">
          <NavLink className="navbar-brand" to="/pets">
            PetConnect
          </NavLink>
          <button
            className="navbar-toggler" type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav ms-auto">
              <li className="nav-item">
                <NavLink
                  to="/pets"
                  className={({ isActive }) =>
                    'nav-link' + (isActive ? ' active' : '')
                  }
                >
                  Mis Mascotas
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  to="/activities"
                  className={({ isActive }) =>
                    'nav-link' + (isActive ? ' active' : '')
                  }
                >
                  Actividades
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  to="/lost-pets"
                  className={({ isActive }) =>
                    'nav-link' + (isActive ? ' active' : '')
                  }
                >
                  Perdidas
                </NavLink>
              </li>
              <li className="nav-item">
                <button
                  className="nav-link btn btn-link"
                  onClick={handleLogout}
                >
                  Logout
                </button>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      {/* Contenedor de toasts */}
      <div
        className="toast-container"
        style={{
          position: 'fixed',
          top: '1rem',
          right: '1rem',
          zIndex: 1080,
        }}
      >
        {toasts.map(t => (
          <Toast key={t.id} {...t} onClose={removeToast} />
        ))}
      </div>

      {/* Rutas */}
      <div className="container mt-4">
        <Routes>
          {/* Redirige raíz a login */}
          <Route path="/" element={<Navigate to="/login" replace />} />

          <Route
            path="/register"
            element={<Register addToast={addToast} />}
          />
          <Route
            path="/login"
            element={<Login addToast={addToast} />}
          />
          <Route
            path="/pets"
            element={<Pets addToast={addToast} />}
          />
          <Route
            path="/activities"
            element={<Activities addToast={addToast} />}
          />
          <Route
            path="/lost-pets"
            element={<LostPets addToast={addToast} />}
          />

          {/* Cualquier otra ruta vuelve a “/” */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </div>
    </>
  );
}
